import React, { useState, useEffect } from 'react';
import { getEvents } from '../../fetch';

import BookingCalendar from 'react-booking-calendar';
import { CalendarWrapper, Container } from './hausboot-rot.styles';

const HausbootRot = () => {
	useEffect(() => {
		setState(getEvents((events) => events[0].start));
	}, []);

	const [state, setState] = useState(null);
	const bookings = [new Date(state), new Date('2021-05-10')];

	return (
		<div>
			<Container>
				<CalendarWrapper>
					{getEvents((events) => console.log(events.map((event) => event.end)))}
					{getEvents((events) => console.log(new Date(events[0].start)))}
					{console.log(new Date('2021-05-10'))}
					<BookingCalendar bookings={bookings} disableHistory />
				</CalendarWrapper>
			</Container>
		</div>
	);
};

export default HausbootRot;
